import React from 'react';
import '../styles/ContainerRegister.css'; // Ensure you create a corresponding CSS file
import Icon from '../components/IconBlack'; 

export default function ContainerRegister() {
    return (
        <div className="port-registry-page">
            <Header />
            <div className="content">
                <div className="form-section">
                    <h2>Register a Container</h2>
                    <form className="port-form">
                        <input type="text" placeholder="Port Name" />
                        <input type="text" placeholder="Zip Code" />
                        <input type="text" placeholder="Country" />
                        <input type="text" placeholder="State" />
                        <input type="text" placeholder="City" />
                        <button type="submit">Register new Port</button>
                    </form>
                </div>
                <div className="image-section">
                    <div className="policy-section">
                        <div className="policy-content">
                            <h3>Learn More about Our Port Registry Policies</h3>
                            <button className="learn-more-button">Learn More!</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

function Header() {
    const navigate = useNavigate();

    const handleLogOut = () => {
        logout();
        navigate('/');
    };
    return (
        <header className="navbar">
            <div className="logo">
                <Icon />
                <span>MyPort Manager</span>
            </div>
            <nav className="nav-links">
                <LogoutButton onClick={handleLogOut} />
            </nav>
        </header>
    );
}
